import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import SignIn from './component/SignIn';
<Route path="/Sign" component={ SignIn } />

ReactDOM.render(
    <App />, document.getElementById('root')
);
